import Router from "./src/components/Router";

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="TaskListPage">
        <Stack.Screen name="Home" component={HomeScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
